import classes from './Basis.module.css';
import React, {useState,useEffect,useHistory} from 'react';


import TextField from '@mui/material/TextField';

function Basis(props){

    const [data,setData] = useState({})

    console.dir(data)

    return (
        <div className={classes.container}>

            {console.dir(data)}

            <TextField value={data.autor} onChange={e=>{setData(prev=>({...prev, autor:e.target.value}))}} label="Autor" variant="standard" />
            <TextField value={data.oe} onChange={e=>{setData(prev=>({...prev, oe:e.target.value}))}} label="OE" variant="standard" />

        </div>
    );
}

export default Basis;
